class dconv_leaky(nn.Module):
        def __init__(self, in_channels, out_channels, kernel_size, stride):
            super(dconv_leaky, self).__init__()
            self.deconv = nn.ConvTranspose3d(in_channels, out_channels, kernel_size=kernel_size, stride=stride, bias=False)
            self.bn1 = nn.BatchNorm3d(out_channels)
            self.relu = nn.LeakyReLU(0.1, inplace=True)
            nn.init.xavier_normal_(self.deconv.weight.data)
            # nn.init.constant_(self.deconv.bias.data, 0.0)
            self.bn1.weight.data.fill_(1)
            self.bn1.bias.data.zero_()
        def forward(self, x):
            x = self.deconv(x)
            x = self.bn1(x)
            x = self.relu(x)
            return x

class testnet(nn.Module):
    def __init__(self):
        super(testnet, self).__init__()
        self.conv1 = dconv_leaky(64, 64, 2, 2)
        self.conv2 = dconv_leaky(64, 64, 2, 2)
    def forward(self, data1):
        conv1 = self.conv1(data1)
        conv2 = self.conv2(data1)
        return torch.cat([conv1, conv2], dim=1)

model = testnet()
dummy_input1 = torch.randn(1, 64, 8, 4, 4, device='cpu')
out = model(dummy_input1)
input_names1 = "input_1"
output_names = ["output1"]
torch.onnx.export(model, (dummy_input1), "tooth_seg.onnx",verbose=True,input_names=[input_names1], output_names=output_names)
